import React from 'react';
import '../style/card.css'
import book from '../book.json'

export default function Card() {
    const json = book.books;
    console.log(json);
  return (
    <div>
        <div className="book">
            {book.map(s => (<li>{s}</li>))}
        </div>
    </div>
  );
}
